function isReactive(a, b) {
  if (!a || !b) return;
  aLow = a.toLowerCase();
  bLow = b.toLowerCase();
  if (aLow !== bLow) return false;
  if ((isUpper(a) && isLower(b)) || (isUpper(b) && isLower(a))) {
    return true;
  }
  return false;
}

function slice2(poly, i) {
  if (i <= 0 || i > poly.length - 1) return poly;
  const end = poly.slice(i + 1);
  const start = poly.slice(0, i - 1); // remove one extra
  return start.concat(end);
}

function test() {
  assert(isReactive('a', 'b'), false);
  assert(isReactive('a', 'B'), false);
  assert(isReactive('A', 'B'), false);
  assert(isReactive('A', 'A'), false);
  assert(isReactive('A', 'a'), true);
  assert(isReactive('a', 'A'), true);
  assert(isReactive('b', 'B'), true);

  const poly = 'aaaaABBBBb';
  assert(slice2(poly, poly.length - 1), 'aaaaABBB');
  assert(slice2(poly, 1), 'aaABBBBb');
  assert(slice2(poly, 0), 'aaaaABBBBb');
}

function assert(actual, expected) {
  if (actual !== expected) {
    console.error(actual, ' is not ', expected);
    process.exit(1);
  }
}
